import React from 'react';
import BackgroundPage from '../pages/backgroundpage.js';
import LoginPage from '../pages/loginpage.js';

function TheLogin() {
    return (
        <div className="login-container">
          <BackgroundPage />
          <div className="login-overlay">
            <LoginPage />
          </div>
        </div>
      );
    }

export default TheLogin;
